import React, { useDebugValue } from "react";
import {EnfantSliderdata} from '../../data';
import EnfantCard from './PagesProprio/EnfantCard';









 const EnfantSlider = () => { 

  const datacamp= EnfantSliderdata.map((data) => {

    return (
      <EnfantCard key={data.key} name={data.name} Age={data.Age}/>
    )
  }) 

  
      return ( 
      <div>

{datacamp}
      </div>
            

          );
        };

 export default EnfantSlider;
